import TshirtData from "./TshirtData";

const Tshirt = (props) => {
    return (
        <div>
            <ol>
                {props.list.map(item => (
                    <li key={item.id}>
                        <TshirtData
                            name={item.name}
                            description={item.description}
                            price={item.price}
                        />
                    </li>
                ))}
            </ol>
        </div>
    );
};

export default Tshirt;
